import React, { useState } from 'react';
import axios from 'axios';

const TelephoneLine = () => {
  const [formData, setFormData] = useState({
    numero_de_gsm: '',
    full_name: '',
    code_entite: '',
    direction: '',
    fonction: '',
    operateur: '',
    categorie: '',
    poste_GSM: ''
  });

  const { numero_de_gsm, full_name, code_entite, direction, fonction, operateur, categorie, poste_GSM } = formData;

  const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value });

  const onSubmit = async e => {
    e.preventDefault();
    try {
      const response = await axios.post('/api/telephone-lines', formData);
      console.log('Telephone Line created:', response.data);
    } catch (err) {
      console.error('Error creating telephone line:', err.response.data);
    }
  };

  return (
    <form onSubmit={onSubmit}>
      <input type="text" name="numero_de_gsm" value={numero_de_gsm} onChange={onChange} placeholder="Numero de GSM" required />
      <input type="text" name="full_name" value={full_name} onChange={onChange} placeholder="Full Name" required />
      <input type="text" name="code_entite" value={code_entite} onChange={onChange} placeholder="Code Entite" required />
      <input type="text" name="direction" value={direction} onChange={onChange} placeholder="Direction" required />
      <input type="text" name="fonction" value={fonction} onChange={onChange} placeholder="Fonction" required />
      <input type="text" name="operateur" value={operateur} onChange={onChange} placeholder="Operateur" required />
      <input type="text" name="categorie" value={categorie} onChange={onChange} placeholder="Categorie" required />
      <input type="text" name="poste_GSM" value={poste_GSM} onChange={onChange} placeholder="Poste GSM" required />
      <button type="submit">Create Telephone Line</button>
    </form>
  );
};

export default TelephoneLine;
